//SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Contrato {
//------------------------------------declaracion de estructuras para variables
    struct MedicalRecord {
        address adressP;
        address adressM;
        string patientName;
        uint age;
        string diagnosis;
        string treatment;
        string date;
        string fileHash;
    }
    struct Patient {
        string   nombreP;
        string   apellidosP;
        string   telefonoP;
        address   adressP;
        string   correoP;
        string   passP;
        bool registradoP;
    }
    struct Med {
        string   nombreM;
        string   apellidosM;
        string   telefonoM;
        address   adressM;
        string   correoM;
        string   passM;
        string    idM;
        string   espM;
        bool registradoM;
    }

    string[] authorizedIDs = ["PS01","PS02","PS03","PS04","PS05"];

//-------------------------------------------------------- Mapeo 
    mapping (address => MedicalRecord[]) records;
    mapping (address => Patient) public patients;
    mapping (address => Med) meds;
    mapping(address => bool) authenticatedPatients;
    mapping(address => bool) authenticatedMed;
    mapping(string => bool) idInUse;

